import Tippy from "@tippyjs/react";
import { Link } from "react-router-dom";
import styles from './MeunuHeaderPopped.module.scss'
import HeaderOfMenu from "./HeaderOfMenu";

function MenuPopped({ data }) {
    const [history, setHistory] = useState([{ data }])
    const current = history[history.length - 1]
    // let onClick = () => {
    //     console.log()
    // }
    const props = {
        onClick
    }
    let Comp = 'div';
    const haveChildren = !!data.children;
    const isChildren = data.length > 1 && true;
    console.log(haveChildren);
    if (haveChildren) {
        onClick = () => {
            console.log(123)
            setHistory(prev => {
                const newData = [...prev, data.children];
                console.log('newData');
                return newData;
            })
        }
    }
    if (data.to) {
        Comp = Link
    }
    return (
        <div>
            {isChildren && <HeaderOfMenu />}
            <Comp to={data.to} className={styles.option} {...props}>

                <div className={styles.icon}>
                    {data.img}
                </div>
                <div>
                    {data.content}
                </div>
                <div className={styles.darkmode}>
                    {data.darkmode}
                </div>
            </Comp>
        </div>
    )
}

export default MenuPopped;
